import React, {Component} from 'react';



class Path extends Component {
	constructor(props){
		super(props)

	}

	componentDidMount(){
	}

	async fetchPathData(params){
		let start = 1603971032
		let end = 1608230858
		let dbId = params.dbId

		const makeRequest = await fetch('/path', {
			method : 'POST',
			body : {
				'stime': start,
				'etime': end,
				'dbId' : dbId
			}
		})
		const getPathData = await fetch('/path').json()
		return getPathData
	}
	render(){
		return (
			<div>
			some path data
			</div>
			)
	}
 }

export default Path;
